import styled from "styled-components";

export const KeyContainer = styled.ul`
    display: flex;
    align-items: center;
    justify-content: space-evenly;
    font-size: 1rem;
    border: 2px solid #ef7360;
    padding: 5px;
    background-redius: 8px;

`;

export const BulletPoint = styled.li`
    :last-child {
        color: red
    }
        @med
`;
